script: |
  super -f tsv -I q6400.sql | sort > q6400.out

vector: true

inputs:
  - name: q6400.sql
    data: |
      SELECT DISTINCT + - col1 AS col2, - CAST ( + + ( - col2 ) AS INTEGER ) AS col2 FROM tab1 AS cor0 WHERE NOT NULL BETWEEN ( col1 * + - col0 * - col2 ) AND - col2;
  - name: tab1

outputs:
  - name: q6400.out
    data: |
